import React, { useEffect } from "react";
import './Home.css'
import { useLocation } from "react-router-dom";
import Profile from "./Profile/Profile";
const Home=(props)=>{
    const location=useLocation();
    const {name,password,email,gender}=location.state || {};
    useEffect(()=>{console.log(name,password,email,gender);},[])
return(<div>
    <div className="container">
            <header>
                <nav>
                    <ul>
                        <li><a href="#">Home</a></li>
                    </ul>
                </nav>
            </header>
            <Profile name={name} email={email} password={password} gender={gender}/>
            <Profile/>
            
            {/* <div>
                <input value={props.name}/>
                <input value={props.email}/>
                <input value={props.password}/>
                <input value={props.gender}/>
            </div> */}
       
    </div>
</div>)
}
export default Home;
